let modoCamara = "environment"; // Trasera por defecto
let currentStream = null;

function iniciarCamara() {
  if (currentStream) {
    currentStream.getTracks().forEach((track) => track.stop());
  }

  navigator.mediaDevices
    .getUserMedia({ video: { facingMode: { ideal: modoCamara } } })
    .then((stream) => {
      currentStream = stream;
      video.srcObject = stream;
    })
    .catch((error) => {
      alert("Error al acceder a la cámara: " + error);
    });
}

function convertirMinutosAHoras(minutos) {
  const totalSegundos = minutos * 60;

  const horas = Math.floor(totalSegundos / 3600);
  const minutosRestantes = Math.floor((totalSegundos % 3600) / 60);
  const segundos = totalSegundos % 60;

  return `${String(horas).padStart(2, "0")}:${String(minutosRestantes).padStart(
    2,
    "0"
  )}:${String(segundos).padStart(2, "0")}`;
}

function cambiarCamara() {
  modoCamara = modoCamara === "user" ? "environment" : "user";
  iniciarCamara();
}

iniciarCamara(); // Inicia la cámara al cargar

function tomarFoto() {
  const context = canvas.getContext("2d");
  canvas.width = video.videoWidth;
  canvas.height = video.videoHeight;
  context.drawImage(video, 0, 0, canvas.width, canvas.height);
  const dataURL = canvas.toDataURL("image/png");
  agregarFoto(dataURL);
}

function abrirGaleria() {
  inputGaleria.click();
}

inputGaleria.addEventListener("change", function () {
  const archivos = inputGaleria.files;
  for (let archivo of archivos) {
    const lector = new FileReader();
    lector.onload = function (e) {
      agregarFoto(e.target.result);
    };
    lector.readAsDataURL(archivo);
  }
});

function agregarFoto(dataURL) {
  fotos.push(dataURL); // Agrega al array

  const contenedor = document.createElement("div");
  contenedor.style.position = "relative";
  contenedor.style.display = "inline-block";
  contenedor.style.margin = "5px";

  const img = document.createElement("img");
  img.src = dataURL;
  img.style.width = "300px";
  img.style.border = "1px solid #ccc";

  const botonEliminar = document.createElement("button");
  botonEliminar.textContent = "❌";
  botonEliminar.style.position = "absolute";
  botonEliminar.style.top = "0";
  botonEliminar.style.right = "0";
  botonEliminar.style.width = "45px";
  botonEliminar.style.height = "40px";
  botonEliminar.style.backgroundColor = "black";
  botonEliminar.style.color = "white";
  botonEliminar.style.border = "none";
  botonEliminar.style.cursor = "pointer";
  botonEliminar.style.fontSize = "25px";
  botonEliminar.style.padding = "2px 5px";

  botonEliminar.onclick = () => {
    const index = fotos.indexOf(dataURL);
    if (index > -1) {
      fotos.splice(index, 1); // Elimina del array
    }
    galeria.removeChild(contenedor); // Elimina del DOM
  };

  contenedor.appendChild(img);
  contenedor.appendChild(botonEliminar);
  galeria.appendChild(contenedor);
}

// Función para comprimir una imagen en base64
async function comprimirImagen(base64, maxWidth = 600, quality = 0.6) {
  return new Promise((resolve) => {
    const img = new Image();
    img.onload = function () {
      const canvas = document.createElement("canvas");
      const scaleFactor = maxWidth / img.width;
      canvas.width = maxWidth;
      canvas.height = img.height * scaleFactor;

      const ctx = canvas.getContext("2d");
      ctx.drawImage(img, 0, 0, canvas.width, canvas.height);
      const compressedBase64 = canvas.toDataURL("image/jpeg", quality);
      resolve(compressedBase64);
    };
    img.src = base64;
  });
}

